  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0125598 contains raw underway
  meteorological, navigational, physical and time series data logged by the Scientific
  Computer System (SCS) aboard NOAA Ship Okeanos Explorer in the Bay of Fundy and
  North Atlantic Ocean from 2014-10-14 to 2014-10-22. Office of Marine and Aviation
  Operations (OMAO) personnel aboard the ship submitted these data and associated
  metadata to NODC. In addition, NODC Accession 0125598 contains supplementary cruise-level
  metadata, which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO
  and NODC personnel developed the automated process to archive these data under the
  auspices of the NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"license_title\":
